import axios from "axios";
import React, { useState } from "react";
import { useParams } from "react-router-dom";

const TakaımDetay = () => {

    let { id } = useParams();
    const [oyuncu, setOyuncu] = useState([])

    const api_link = `https://cryptic-gorge-72989.herokuapp.com/teams/${id}`
    axios.get(api_link)
        .then(response => {
            setOyuncu(response.data)
        }, [id])
    return (
        <div>
            <div>
                {
                    oyuncu.map(takım=>
                        <div>
                            {takım.name}
                        </div>
                        )
                }
            </div>

        </div>
    )
}
export default TakaımDetay;
